import React from "react";
import biograms from "../biograms";
import BiogramCard from "src/components/BiogramCard/BiogramCard";

const BiogramList = () => {
  const biogramList = Object.entries(biograms);
  return (
    <div className="grid grid-flow-col grid-cols-3 grid-rows-3 gap-4">
      {biogramList.map(({ key, person }) => (
        <BiogramCard person={person} key={person.surname + person.name} />
      ))}
    </div>
  );
};

export default BiogramList;
